package model.entity;import javax.persistence.*;@Entity@Table(name = "profil", schema = "", catalog = "registru")public class ProfilEntity {    private long idProfil;    private String username;    private String nume;    private String prenume;    private String email;    private String tel;    private String workTel;    private String fax;    @Id    @Column(name = "id_profil", nullable = false, insertable = true, updatable = true)    public long getIdProfil() {        return idProfil;    }    public void setIdProfil(long idProfil) {        this.idProfil = idProfil;    }    @Basic    @Column(name = "username", nullable = false, insertable = true, updatable = true)    public String getUsername() {        return username;    }    public void setUsername(String idUser) {        this.username = idUser;    }    @Basic    @Column(name = "nume", nullable = false, insertable = true, updatable = true, length = 250)    public String getNume() {        return nume;    }    public void setNume(String nume) {        this.nume = nume;    }    @Basic    @Column(name = "prenume", nullable = false, insertable = true, updatable = true, length = 250)    public String getPrenume() {        return prenume;    }    public void setPrenume(String prenume) {        this.prenume = prenume;    }    @Basic    @Column(name = "email", nullable = true, insertable = true, updatable = true, length = 250)    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    @Basic    @Column(name = "tel", nullable = true, insertable = true, updatable = true, length = 250)    public String getTel() {        return tel;    }    public void setTel(String tel) {        this.tel = tel;    }    @Basic    @Column(name = "work_tel", nullable = true, insertable = true, updatable = true, length = 250)    public String getWorkTel() {        return workTel;    }    public void setWorkTel(String workTel) {        this.workTel = workTel;    }    @Basic    @Column(name = "fax", nullable = true, insertable = true, updatable = true, length = 250)    public String getFax() {        return fax;    }    public void setFax(String fax) {        this.fax = fax;    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (!(o instanceof ProfilEntity)) return false;        ProfilEntity that = (ProfilEntity) o;        if (idProfil != that.idProfil) return false;        if (username != null ? !username.equals(that.username) : that.username != null) return false;        if (nume != null ? !nume.equals(that.nume) : that.nume != null) return false;        if (prenume != null ? !prenume.equals(that.prenume) : that.prenume != null) return false;        if (email != null ? !email.equals(that.email) : that.email != null) return false;        if (tel != null ? !tel.equals(that.tel) : that.tel != null) return false;        if (workTel != null ? !workTel.equals(that.workTel) : that.workTel != null) return false;        return !(fax != null ? !fax.equals(that.fax) : that.fax != null);    }    @Override    public int hashCode() {        int result = (int) (idProfil ^ (idProfil >>> 32));        result = 31 * result + (username != null ? username.hashCode() : 0);        result = 31 * result + (nume != null ? nume.hashCode() : 0);        result = 31 * result + (prenume != null ? prenume.hashCode() : 0);        result = 31 * result + (email != null ? email.hashCode() : 0);        result = 31 * result + (tel != null ? tel.hashCode() : 0);        result = 31 * result + (workTel != null ? workTel.hashCode() : 0);        result = 31 * result + (fax != null ? fax.hashCode() : 0);        return result;    }}